import {
  Routes,
  BrowserRouter as Router,
  Route,
} from 'react-router-dom';
import { Home } from './pages/Home';

function App() {
  console.log('Hello');
  return (
    <Router>
      <Routes>
        <Route path="/:postPageCount" element={<Home />}></Route>
      </Routes>
    </ Router>
  );
}

export default App;
